import React, {useEffect} from 'react';
import styles from './Header.module.css';
import { Logo, BurgerIcon, ListIcon, ProfileIcon } from '@ya.praktikum/react-developer-burger-ui-components'
import NavButton from "../NavButton/NavButton";


const Header = () => {
    const [current, setCurrent] = React.useState('one');

    useEffect(() => {
        console.log(current)
    },[current])

    return (
        <header className={styles.header}>
            <div className={`${styles.header__container} pt-4 pb-4`}>
                <div className={styles.header__nav}>
                    <NavButton value="one" icon={<BurgerIcon type={current === "one" ? "primary" : "secondary"} />} text="Конструктор" onClick={setCurrent}/>
                    <NavButton value="two" icon={<ListIcon type={current === "two" ? "primary" : "secondary"} />} text="Лента заказов" onClick={setCurrent}/>
                </div>
                <div className={styles.logo}>
                    <Logo/>
                </div>
                <NavButton value="three" icon={<ProfileIcon type={current === "three" ? "primary" : "secondary"} />} text="Личный кабинет" onClick={setCurrent}/>
            </div>
        </header>
    );
};

export default Header;
